export const authInterceptor = (req, next) => {
  const token = localStorage.getItem('token');
  console.log('AuthInterceptor: URL', req.url, 'Token:', token ? 'Present' : 'Missing');
  if (token) {
    const authReq = req.clone({
      setHeaders: {
        Authorization: `Bearer ${token}`
      }
    });
    return next(authReq);
  }
  return next(req);
};
